de:
Das Territorialprojekt für das untere Saanetal ist eines der ehrgeizigsten Projekte zur Anpassung an den Klimawandel und zur räumlichen Neugestaltung eines Küstengebiets. Zu den Zielen des Projekts gehören:?

? Antworten auf die Folgen des Klimawandels zu finden (Risiko von Meeresüberflutungen und Überschwemmungen);

? Förderung des sozioökonomischen Gefüges unter Berücksichtigung der aktuellen und zukünftigen Nutzung des unteren Tals;

? Ein Ökosystem von Küstenfeuchtgebieten wiederherzustellen, das die Biodiversität fördert.

Die vorliegende vorherige Konzertierung wird auf Initiative des Syndicat Mixte des Bassins Versants Saane Vienne Scie und des Conservatoire du Littoral organisiert.

Ziel ist es, die verschiedenen Maßnahmen des territorialen Projekts vorzustellen und insbesondere die neue, für die Wiederanbindung der Saane an das Meer vorgesehene Planungsvariante, die einen Teil des Projekts darstellt. Die Ziele dieser Konzertierung sind vielfältig:

? Die Strategie zur Umsetzung des territorialen Projekts in Erinnerung rufen;

? Die Merkmale und Hauptrichtungen des Projekts zur Wiederanbindung der Saâne darlegen;

? Über die damit verbundenen ökologischen, sozioökonomischen und resilienten Herausforderungen sowie über die Entwicklungen in der Raumplanung informieren;

? Die Meinungen und Anliegen von Anwohnern, lokalen Verbänden und anderen betroffenen Personen einholen, um das Projekt zu bereichern.

en:
The Projet Territorial de la Basse Vallée de la Saâne (Lower Saâne Valley Territorial Project) is one of the most ambitious projects in terms of adapting to climate change and the spatial reorganization of a coastal area. Its objectives include:?

? Provide solutions to the consequences of climate change (risk of marine submersion and flooding);

? Promote the socio-economic fabric by taking into account current and future uses of the lower valley;

? Restore a coastal wetland ecosystem conducive to biodiversity.

This preliminary consultation has been organized on the initiative of the Syndicat Mixte des Bassins Versants Saane Vienne Scie and the Conservatoire du Littoral.

Its aim is to present the various actions of the territorial project and, more specifically, the new development plan envisaged for the reconnection of the Saâne to the sea, which is one of its components. The objectives of this consultation are manifold:

? Review the strategy for implementing the territorial project;

? Present the characteristics and main orientations of the Saâne reconnection project;

? Provide information on the ecological, socio-economic and resilience issues involved, as well as on developments in regional planning;

? Gather the opinions and concerns of residents, local associations and any other interested parties in order to enrich the project.

it:
Il Projet Territorial de la Basse Vallée de la Saâne (Progetto Territoriale della Bassa Valle della Saâne) è uno dei progetti più ambiziosi in termini di adattamento ai cambiamenti climatici e di riorganizzazione territoriale di un'area costiera. I suoi obiettivi comprendono:?

? Fornire risposte alle conseguenze del cambiamento climatico (rischio di sommersione marina e inondazioni);

? Promuovere il tessuto socio-economico tenendo conto degli usi attuali e futuri della bassa valle;

? Ripristinare un ecosistema di zona umida costiera favorevole alla biodiversità.

Questa consultazione preliminare è stata organizzata su iniziativa del Syndicat Mixte des Bassins Versants Saane Vienne Scie e del Conservatoire du Littoral.

Lo scopo è quello di presentare le varie azioni del progetto territoriale e, più in particolare, il nuovo piano di sviluppo previsto per la riconnessione della Saâne al mare, che è una delle sue componenti. La consultazione ha diversi obiettivi:

? Rivedere la strategia di attuazione del progetto territoriale;

? Presentare le caratteristiche e gli orientamenti principali del progetto di riconnessione della Saâne;

? Fornire informazioni sulle questioni ecologiche, socio-economiche e di resilienza coinvolte, nonché sugli sviluppi della pianificazione regionale;

? Raccogliere le opinioni e le preoccupazioni dei residenti, delle associazioni locali e di qualsiasi altra parte interessata per arricchire il progetto.

fr:
Le Projet Territorial de la Basse Vallée de la Saâne constitue l’un des projets les plus ambitieux en matière d’adaptation au changement climatique et de recomposition spatiale d’un territoire littoral. Il a notamment pour objectifs :   

• D’apporter des réponses face aux conséquences du changement climatique (risque de submersion marines et inondations) ; 

• De favoriser le tissu socio-économique en prenant en compte les usages actuels et futurs de la basse vallée ;

• De rétablir un écosystème de zones humides littorales favorable à la biodiversité.

La présente concertation préalable est organisée à l’initiative du Syndicat Mixte des Bassins Versants Saane Vienne Scie et Conservatoire du Littoral. 

Elle vise à présenter les différentes actions du projet territorial et plus particulièrement, le nouveau parti d’aménagement envisagé pour la reconnexion de la Saâne à la mer qui en constitue l’un des volet. Les objectifs de cette concertation sont multiples :

• Rappeler la stratégie de mise en œuvre du projet territorial ;

• Présenter les caractéristiques et les principales orientations du projet de reconnexion de la Saâne ;

• Informer sur les enjeux écologiques, socio-économiques et de résilience qui s’y rattachent ainsi que sur les évolutions de l’aménagement du territoire ;

• Recueillir l’avis et les préoccupations des habitants, des associations locales et de toute autre personne concernée afin d’enrichir le projet.

nl:
Het Projet Territorial de la Basse Vallée de la Saâne (Territoriaal Project Beneden-Saânevallei) is een van de meest ambitieuze projecten op het gebied van aanpassing aan klimaatverandering en de ruimtelijke reorganisatie van een kustgebied. De doelstellingen zijn onder andere:?

? Antwoorden bieden op de gevolgen van de klimaatverandering (risico op overstroming van de zee en overstromingen);

? De sociaaleconomische structuur bevorderen door rekening te houden met het huidige en toekomstige gebruik van de vallei;

? Herstel van een waterrijk ecosysteem aan de kust dat gunstig is voor de biodiversiteit.

Dit voorbereidend overleg werd georganiseerd op initiatief van het Syndicat Mixte des Bassins Versants Saane Vienne Scie en het Conservatoire du Littoral.

Het doel is om de verschillende acties van het territoriale project voor te stellen en meer bepaald het nieuwe ontwikkelingsplan dat voorzien is voor de herverbinding van de Saâne met de zee, een van de onderdelen ervan. De raadpleging heeft een aantal doelstellingen:

? De strategie voor de uitvoering van het territoriale project herzien;

? De kenmerken en belangrijkste oriëntaties van het project voor de herverbinding van de Saâne voorstellen;

? Informatie verschaffen over de ecologische, sociaaleconomische en veerkrachtkwesties in kwestie, evenals over ontwikkelingen in regionale planning;

? De meningen en zorgen van bewoners, lokale verenigingen en andere geïnteresseerde partijen verzamelen om het project te verrijken.

