El Projet Territorial de la Basse Vallée de la Saâne (Proyecto Territorial del Bajo Valle del Saona) es uno de los proyectos más ambiciosos de adaptación al cambio climático y reorganización espacial de una zona costera. Sus objetivos son los siguientes

? Dar respuestas a las consecuencias del cambio climático (riesgo de sumersión marina e inundaciones);

? Promover el tejido socioeconómico teniendo en cuenta los usos actuales y futuros del valle inferior;

? Restaurar un ecosistema de humedales costeros favorable a la biodiversidad.

Esta consulta preliminar ha sido organizada por iniciativa del Syndicat Mixte des Bassins Versants Saane Vienne Scie y el Conservatoire du Littoral.

Su objetivo es presentar las distintas acciones del proyecto territorial y, más concretamente, el nuevo plan de desarrollo previsto para la reconexión del Saona con el mar, que es uno de sus componentes. La consulta tiene varios objetivos:

? Revisar la estrategia de aplicación del proyecto territorial;

? Presentar las características y principales orientaciones del proyecto de reconexión del Saona;

? Proporcionar información sobre las cuestiones ecológicas, socioeconómicas y de resiliencia implicadas, así como sobre la evolución de la planificación regional;

? Recoger las opiniones y preocupaciones de los residentes, las asociaciones locales y cualquier otra parte interesada con el fin de enriquecer el proyecto.

